/* eslint-disable @next/next/no-img-element */
import * as motion from "motion/react-client"
import type { Variants } from "motion/react"

export default function ScrollTriggered() {
    return (
        <div>
            {Object.entries(obj).map(([category, technologies]) => (
                <div key={category} className="w-full my-8 text-2xl font-bold relative">
                    <motion.p 
                        className="text-4xl w-full font-bold text-center -mb-3 "
                        initial={{ opacity: 0, scale: 0.5 }}
                        animate={{ opacity: 1, scale: 1 }}
                        variants={{
                            offscreen: { opacity: 0, scale: 0.5 },
                            onscreen: { opacity: 1, scale: 1 },
                        }}
                        transition={{
                            duration: 0.8,
                            delay: 0.5,
                            ease: [0, 0.71, 0.2, 1.01],
                        }}
                    >{category}</motion.p>
                    <div className="grid grid-cols-3 sm:grid-cols-4 lg:grid-cols-5 gap-x-4 gap-y-12 sm:gap-y-20 p-4 mt-4 mb-24 pb-[100px] w-full">
                        {technologies.map(({ name, logo, hueA, hueB }, i) => (
                            <Card i={i} emoji={logo} hueA={hueA} hueB={hueB} key={name} name={name} category={category}/>
                        ))}
                    </div>
                </div>
            ))}
        </div>
    )
}

interface CardProps {
    name: string,
    emoji: React.ReactNode,
    hueA: number
    hueB: number
    i: number,
    category: string
}

function Card({ name, emoji, hueA, hueB, i, category }: CardProps) {
    const background = `linear-gradient(306deg, ${hue(hueA)}, ${hue(hueB)})`

    return (
        <motion.div
            className={`card-container-${i} overflow-hidden flex justify-center items-center relative pt-[20px] mb-[-120px]`}
            initial="offscreen"
            whileInView="onscreen"
            viewport={{ amount: 0.8 }}
        >
            <div style={{ ...splash, background }} className="absolute right-0 left-0 bottom-0 top-0 clip"/>
            <motion.div
            variants={cardVariants} 
            className="text-9xl w-[150px] h-[200px] p-4 sm:h-40 sm:w-32 lg:h-60 lg:w-44 flex justify-center items-center rounded-2xl bg-white shadow-2xl border origin-[10%_60%] relative">
                {category !== "Frontend" && <div className="absolute top-0 m-2 text-sm">{name}</div>}
                {emoji}
            </motion.div>
        </motion.div>
    )
}

const cardVariants: Variants = {
    offscreen: {
        y: 200,
    },
    onscreen: {
        y: 50,
        rotate: -10,
        transition: {
            type: "spring",
            bounce: 0.4,
            duration: 0.8,
        },
    },
}

const hue = (h: number) => `hsl(${h}, 100%, 50%)`

